import React from "react"
import links from "../links"
import Link from "./Link"

function createLink(data){
    return (<Link 
    key = {data.id}
    linkname= {data.name}
    linkurl = {data.url}
    />)
}

function NavBar(){

    return (
    <ul>

        {links.map(createLink)}


    </ul>
    )
}

export default NavBar;
